var _Assetsbfdf4a3e904014e3d8fb363c3d1206b6f5180288 = "<!DOCTYPE html>\n<html>\n<head>\n  <meta charset=\"utf-8\">\n  <title>Rizin Notebook</title>\n  <link rel=\"stylesheet\" href=\"{{ .root }}static/spectre-icons.min.css\">\n  <link rel=\"stylesheet\" href=\"{{ .root }}static/spectre.min.css\">\n  <link rel=\"stylesheet\" href=\"{{ .root }}static/simplemde.min.css\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\" />\n  <style type=\"text/css\">\n    html, body { width: 100%; height: 100%; margin: 0 }\n    .button-edit { width: 75px ! important; margin-top: 9px; margin-right: 9px; }\n  </style>\n</head>\n  <form style=\"margin-top: 15px; height: 100%;\" action=\"{{ .root }}output/exec/{{ .nonce }}\" method=\"POST\">\n    <div class=\"form-group\">\n      <input type=\"text\" class=\"form-input\" name=\"command\" value=\"\" placeholder=\"Rizin command for example: pdf\"/>\n    </div>\n    <div class=\"form-group\">\n      <button class=\"btn btn-primary\" type=\"submit\">Exec</button>\n      <a class=\"btn\" href=\"{{ .root }}output/deleted\">Cancel</a>\n    </div>\n  </form>\n</body>\n</html>"
var _Assets8d74849a5560d3b62ca6202780224621d98ab7c3 = "{{ $root := .root }}{{ $page := .page }}{{ $nlen := len .nonce }}<!DOCTYPE html>\n<html lang=\"en\">\n  <head>\n    <meta charset=\"utf-8\">\n    <title>Rizin Notebook</title>\n    <link rel=\"stylesheet\" href=\"{{ $root }}static/spectre-icons.min.css\">\n    <link rel=\"stylesheet\" href=\"{{ $root }}static/spectre.min.css\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\" />\n    <style type=\"text/css\">\n        .spacing-top { margin: 3px 0px 0px 0px; }\n        .spacing-left { margin: 0px 3px 0px 0px; }\n        .navbar-fixed-height { height: 32px; }\n        .icon-height { height: 20px; }\n        iframe { border: 0px; width: 100%; height: 100% }\n    </style>\n  </head>\n<body>\n  <section class=\"container grid-960 mt-10\">\n    <header class=\"navbar navbar-fixed-height\">\n      <section class=\"navbar-section\">\n        <a href=\"{{ $root }}\" class=\"navbar-brand mr-10\">Rizin Notebook</a>\n      </section>\n      <section class=\"navbar-section\">\n        {{ $page.title }}\n      </section>\n    </header>\n    <section class=\"container\">\n      <div class=\"columns\">\n        <div class=\"column\">\n          <form action=\"{{ $root }}edit\" method=\"POST\" enctype=\"multipart/form-data\">\n            <div class=\"form-group\">\n              <input type=\"hidden\" name=\"nonce\" value=\"{{ .nonce }}\" />\n              <input type=\"text\" class=\"form-input\" name=\"title\" value=\"{{ .title }}\" placeholder=\"Notebook page title\"/>\n              {{ if lt $nlen 1 }}\n              <br>\n              <label for=\"binary\">Choose a binary to open: </label>\n              <input type=\"file\" id=\"binary\" name=\"binary\">\n              {{ end }}\n            </div>\n            <div class=\"form-group\">\n              <button class=\"btn btn-primary\" type=\"submit\">{{ if lt $nlen 1 }}Create{{ else }}Save{{ end }}</button>\n              <a class=\"btn\" href=\"{{ $root }}\">Cancel</a>\n              {{ if gt $nlen 0 }}\n              <a class=\"btn float-right\" href=\"{{ $root }}delete/{{ .nonce }}\">Delete</a>\n              {{ end }}\n            </div>\n          </form>\n        </div>\n      </div>\n    </section>\n  </section>\n</body>\n</html>"
